import React, { useState } from "react";
import styled from "styled-components";

const MyPageContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 40px 20px;
  min-height: 80vh;
`;

const PageHeader = styled.div`
  margin-bottom: 40px;

  h1 {
    color: ${(props) => props.theme.colors.dark};
    margin-bottom: ${(props) => props.theme.spacing.sm};
  }

  p {
    color: ${(props) => props.theme.colors.gray[600]};
  }
`;

const ContentGrid = styled.div`
  display: grid;
  grid-template-columns: 250px 1fr;
  gap: 30px;

  @media (max-width: ${(props) => props.theme.breakpoints.tablet}) {
    grid-template-columns: 1fr;
  }
`;

const Sidebar = styled.div`
  background-color: white;
  border-radius: ${(props) => props.theme.borderRadius.md};
  box-shadow: ${(props) => props.theme.shadows.md};
  padding: 20px;
  height: fit-content;
`;

const SidebarMenu = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
`;

const MenuItem = styled.li`
  margin-bottom: 10px;
`;

const MenuButton = styled.button`
  width: 100%;
  text-align: left;
  padding: 12px;
  border: none;
  border-radius: ${(props) => props.theme.borderRadius.sm};
  background-color: ${(props) =>
    props.active ? props.theme.colors.primary : "transparent"};
  color: ${(props) => (props.active ? "white" : props.theme.colors.dark)};
  cursor: pointer;
  font-weight: ${(props) => (props.active ? "bold" : "normal")};
  transition: all 0.2s ease;

  &:hover {
    background-color: ${(props) =>
      props.active ? props.theme.colors.primary : props.theme.colors.gray[100]};
  }
`;

const MainContent = styled.div`
  background-color: white;
  border-radius: ${(props) => props.theme.borderRadius.md};
  box-shadow: ${(props) => props.theme.shadows.md};
  padding: 30px;
`;

const SectionTitle = styled.h2`
  margin-bottom: 20px;
  border-bottom: 2px solid ${(props) => props.theme.colors.gray[200]};
  padding-bottom: 10px;
  color: ${(props) => props.theme.colors.dark};
`;

const FormGrid = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 20px;
  margin-bottom: 20px;

  @media (max-width: ${(props) => props.theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const FormGroup = styled.div`
  display: flex;
  flex-direction: column;

  label {
    display: block;
    margin-bottom: 5px;
    font-weight: bold;
    color: ${(props) => props.theme.colors.dark};
  }

  input {
    width: 100%;
    padding: 10px;
    border: 1px solid ${(props) => props.theme.colors.gray[300]};
    border-radius: ${(props) => props.theme.borderRadius.sm};

    &:focus {
      border-color: ${(props) => props.theme.colors.primary};
      outline: none;
    }
  }
`;

const SaveButton = styled.button`
  padding: 10px 20px;
  background-color: ${(props) => props.theme.colors.primary};
  color: white;
  border: none;
  border-radius: ${(props) => props.theme.borderRadius.sm};
  cursor: pointer;
  font-weight: bold;
  transition: background-color 0.2s ease;

  &:hover {
    background-color: ${(props) => props.theme.colors.primary}dd;
  }
`;

const BookingCard = styled.div`
  border: 1px solid ${(props) => props.theme.colors.gray[300]};
  border-radius: ${(props) => props.theme.borderRadius.md};
  padding: 20px;
  margin-bottom: 15px;
  transition: border-color 0.2s ease;

  &:hover {
    border-color: ${(props) => props.theme.colors.primary};
  }
`;

const BookingHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: start;
  margin-bottom: 10px;

  h4 {
    margin: 0;
    color: ${(props) => props.theme.colors.dark};
  }
`;

const StatusBadge = styled.span`
  padding: 4px 8px;
  border-radius: ${(props) => props.theme.borderRadius.sm};
  font-size: 12px;
  font-weight: bold;
  background-color: ${(props) =>
    props.status === "confirmed"
      ? props.theme.colors.success + "20"
      : props.theme.colors.warning + "20"};
  color: ${(props) =>
    props.status === "confirmed"
      ? props.theme.colors.success
      : props.theme.colors.warning};
`;

const BookingDetails = styled.div`
  p {
    margin: 5px 0;
    color: ${(props) => props.theme.colors.gray[600]};
  }
`;

const MyPage = () => {
  const [activeTab, setActiveTab] = useState("profile");
  const [userInfo, setUserInfo] = useState({
    name: "ÌôçÍ∏∏Îèô",
    email: "hong@example.com",
    phone: "010-1234-5678",
  });

  const menuItems = [
    { id: "profile", label: "ÌîÑÎ°úÌïÑ ÏÑ§Ï†ï" },
    { id: "bookings", label: "ÏòàÏïΩ ÎÇ¥Ïó≠" },
    { id: "favorites", label: "Ï∞úÌïú ÏàôÏÜå" },
    { id: "settings", label: "Í≥ÑÏ†ï ÏÑ§Ï†ï" },
  ];

  const mockBookings = [
    {
      id: 1,
      title: "Ï†úÏ£ºÎèÑ Ïò§ÏÖòÎ∑∞ ÌéúÏÖò",
      dates: "2024-03-15 ~ 2024-03-17",
      guests: 2,
      price: "‚Ç©180,000",
      status: "confirmed",
    },
    {
      id: 2,
      title: "Î∂ÄÏÇ∞ Ìï¥Ïö¥ÎåÄ Ìò∏ÌÖî",
      dates: "2024-04-01 ~ 2024-04-03",
      guests: 4,
      price: "‚Ç©320,000",
      status: "pending",
    },
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUserInfo((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSave = () => {
    console.log("ÌîÑÎ°úÌïÑ Ï†ÄÏû•:", userInfo);
  };

  const renderContent = () => {
    switch (activeTab) {
      case "profile":
        return (
          <div>
            <SectionTitle>ÌîÑÎ°úÌïÑ ÏÑ§Ï†ï</SectionTitle>
            <FormGrid>
              <FormGroup>
                <label>Ïù¥Î¶Ñ</label>
                <input
                  type="text"
                  name="name"
                  value={userInfo.name}
                  onChange={handleInputChange}
                />
              </FormGroup>
              <FormGroup>
                <label>Ïù¥Î©îÏùº</label>
                <input
                  type="email"
                  name="email"
                  value={userInfo.email}
                  onChange={handleInputChange}
                />
              </FormGroup>
              <FormGroup>
                <label>Ï†ÑÌôîÎ≤àÌò∏</label>
                <input
                  type="tel"
                  name="phone"
                  value={userInfo.phone}
                  onChange={handleInputChange}
                />
              </FormGroup>
            </FormGrid>
            <SaveButton onClick={handleSave}>Î≥ÄÍ≤ΩÏÇ¨Ìï≠ Ï†ÄÏû•</SaveButton>
          </div>
        );

      case "bookings":
